import './Home.css';
import back from './img/back-icon.png';

export const Home = () => {
    return (
        <div className="home">
            <div className='header'>
                <div className='back-icon'>
                    <img src={back} alt="back" />
                    <h4>back</h4>
                </div>
                <div></div>
            </div>
        </div>
    );
};
